export default {
    "select": {
        "title": "title",
        "untitled": "untitled"
    },
    prepare({formData}) {
        const localeId = "locale:no"
        const title = formData.title && formData.title[localeId]
        const untitled = formData.sectionType && "Untitled " + formData.sectionType

        return {
            title: title,
            untitled: untitled,
        }

    }
}
